// src/theme.js
export const darkTheme = {
  background: '#1b1b1b',   // Fondo oscuro global
  text: '#ffffff',         // Texto blanco
  navbar: '#2c2c2c',       // Fondo de la barra de navegación
  primaryButton: '#ffc107', // Color amarillo para botones primarios
  primaryButtonHover: '#e0a800', // Color amarillo oscuro al hacer hover
  cardBackground: '#2a2a2a' // Fondo de las tarjetas
};
